  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: center;

  flex-wrap: wrap;
`;

const PosterDiv = styled.div``;
const ContentDiv = styled.div``;

const MyApp = () => {
  return (
    <Wrapper>
      <MovieBox />
      <MovieBox />
      <MovieBox />
      <MovieBox />
    </Wrapper>
  );
};

export default MyApp;
